import { Box } from "@mui/material";
import {Items} from './Items';

export const Home = () => {
  return (
    <div style={{ width: '100%' }}>
    <Box
      sx={{
        display: 'flex',
        flexWrap: 'nowrap',
        p: 1,
        m: 1,
        bgcolor: 'background.paper',
        maxWidth: 300,
        borderRadius: 1,
      }}
    >
      <Item>Item 1</Item>
      <Item>Item 2</Item>
      <Item>Item 3</Item>
      <Item>Item 4</Item>
      <Item>Item 5</Item>
      <Item>Item 6</Item>
    </Box>
  </div>
  );
};
